Comedy Nights With Kapil

Season 1 Ep. 33
Released: 03/11/13
Running time: 1:05:03

On the occassion of Diwali, Kapil and his family members celebrate the festival with a bang. Krrish aka Hritik Roshan graces the show with his presence. Kapil's family members have a fun filled time with Hritik and dance with him. Hritik later, answers the question of his fans and fulfills their requests. Witness all the fun by seeing the entire epsiode.

Renowned, actor-comedian Kapil Sharma makes his debut as a TV show producer with his new show Comedy Nights With Kapil. He will be seen multiple roles of an actor, scriptwriter and producer in his production debut. Already famous for his amazing comic timing and his talent to dig humor out of any situation, he is ready present everyday life in a fresh ad unique way.

